    data: |
      SELECT ALL col0 * + col2 FROM tab1 (FORMAT parquet) WHERE NOT ( NULL < ( + col2 / + col0 ) ) AND NOT col0 - col1 NOT IN ( - col0 * - col0 );
  - name: tab1

outputs:
  - name: q10176.out
    data: |
